// Update current year in title and footer
function updateCurrentYear() {
    const currentYear = new Date().getFullYear();
    document.getElementById('current-year').textContent = currentYear;
    document.getElementById('footer-year').textContent = currentYear;
    document.getElementById('next-year').textContent = currentYear;
}

// Check registration period (April 1 to June 5 every year)
function checkRegistrationPeriod() {
    const now = new Date();
    const currentYear = now.getFullYear();
    
    // Registration opens April 1 and closes June 5 each year
    const registrationOpenDate = new Date(currentYear, 3, 1); // April 1 (month is 0-indexed)
    const registrationCloseDate = new Date(currentYear, 5, 5); // June 5
    
    const isRegistrationOpen = now >= registrationOpenDate && now <= registrationCloseDate;
    
    // Get registration elements
    const registrationForm = document.getElementById('registrationForm');
    const registrationClosedNotice = document.querySelector('.registration-closed-notice');
    const nextOpeningDate = document.getElementById('next-opening-date');
    
    if (isRegistrationOpen) {
        // Show form and hide notice
        if (registrationForm) registrationForm.style.display = 'grid';
        if (registrationClosedNotice) registrationClosedNotice.style.display = 'none';
        
        // Update notice text for next closure
        if (nextOpeningDate) {
            nextOpeningDate.textContent = `Registration will close on June 5, ${currentYear}.`;
        }
    } else {
        // Hide form and show notice
        if (registrationForm) registrationForm.style.display = 'none';
        if (registrationClosedNotice) registrationClosedNotice.style.display = 'block';
        
        // Update notice text with next opening date
        let nextOpeningText = '';
        if (now < registrationOpenDate) {
            nextOpeningText = `Registration will open on April 1, ${currentYear}.`;
        } else {
            nextOpeningText = `Registration will open on April 1, ${currentYear + 1}.`;
        }
        
        if (nextOpeningDate) {
            nextOpeningDate.textContent = nextOpeningText;
        }
    }
    
    return isRegistrationOpen;
}

