// Update selected camps display
function updateSelectedCamps() {
    const selectedCampsDiv = document.getElementById('selectedCamps');
    const checkedCamps = document.querySelectorAll('input[name="camps"]:checked');
    const campNames = Array.from(checkedCamps).map(camp => camp.value);
    const totalCost = campNames.length * 500;
    
    const campsText = campNames.length > 0 
        ? `Selected Camps: ${campNames.join(', ')}` 
        : 'Selected Camps: None';
        
    const costText = `Total Cost: ₹${totalCost}`;
    
    selectedCampsDiv.innerHTML = `
        <div class="selected-camps-text">${campsText}</div>
        <div class="selected-camps-cost">${costText}</div>
    `;
}

// Add event listeners to checkboxes
document.addEventListener("DOMContentLoaded", function() {
    updateCurrentYear();
    
    const checkboxes = document.querySelectorAll('input[name="camps"]');
    checkboxes.forEach(checkbox => {
        checkbox.addEventListener('change', updateSelectedCamps);
    });
    
    // Initialize year selector
    populateYearSelector();
    
    // Update date and time
    updateDateTime();
    setInterval(updateDateTime, 1000);
    
    // Check registration period on load and every hour
    checkRegistrationPeriod();
    setInterval(checkRegistrationPeriod, 3600000); // 1 hour
    
    // Admin authentication
    authenticateUser();
    
    // Show statistics section by default
    showSection('statistics');
});

// Populate year selector with years from 2023 to current year
function populateYearSelector() {
    const yearSelector = document.getElementById("yearSelector");
    const currentYear = new Date().getFullYear();
    const startYear = 2023; // Starting from 2023 as a reasonable range
    
    for (let year = currentYear; year >= startYear; year--) {
        const option = document.createElement("option");
        option.value = year;
        option.textContent = year;
        yearSelector.appendChild(option);
    }
}

// Handle year selection for statistics
function checkAndFetchStatistics() {
    const selectedYear = document.getElementById("yearSelector").value;
    
    if (selectedYear) {
        fetchStatistics(selectedYear);
    } else {
        // Reset table if no year is selected
        document.querySelectorAll('#statistics td:nth-child(2)').forEach(cell => {
            cell.textContent = '0';
        });
    }
}

// Year selector event
document.getElementById("yearSelector").addEventListener("change", function() {
    checkAndFetchStatistics();
});

// Fetch statistics from Google Apps Script
function fetchStatistics(year) {
    const scriptUrl = 'https://script.google.com/macros/s/AKfycbw5BMMSbTwsztpV3rfrlOR3FAkOy1KdsHhiM3TPTXKa9eVDtaXWOrqiu0cVSAv0i7YsBw/exec';
    
    // Show loading state
    document.querySelectorAll('#statistics td:nth-child(2)').forEach(cell => {
        cell.textContent = 'Loading...';
        cell.style.color = 'var(--text-secondary)';
    });
    
    fetch(`${scriptUrl}?year=${year}`)
        .then(response => {
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            return response.json();
        })
        .then(data => {
            if (data.error) {
                throw new Error(data.error);
            }
            
            // Update the statistics table with fetched data
            document.getElementById("scienceToyTotal").textContent = data["Science Toy"] || 0;
            document.getElementById("scienceToy2ndTotal").textContent = data["Science Toy 2nd Batch"] || 0;
            document.getElementById("physicsTotal").textContent = data["Physics"] || 0;
            document.getElementById("lifeScienceTotal").textContent = data["Life Science"] || 0;
            document.getElementById("chemistryTotal").textContent = data["Chemistry"] || 0;
            document.getElementById("mathematicsTotal").textContent = data["Mathematics"] || 0;
            document.getElementById("arduinoTotal").textContent = data["Arduino"] || 0;
            document.getElementById("electronicsTotal").textContent = data["Electronics & Application"] || 0;
            document.getElementById("fantasticityTotal").textContent = data["Fantasticity Electricity"] || 0;
            document.getElementById("roboticsTotal").textContent = data["Robotics"] || 0;
            document.getElementById("astronomyTotal").textContent = data["Astronomy"] || 0;
            
            // Restore text color
            document.querySelectorAll('#statistics td:nth-child(2)').forEach(cell => {
                cell.style.color = 'var(--text-primary)';
            });
        })
        .catch(error => {
            console.error('Error fetching statistics:', error);
            alert('Error loading statistics: ' + error.message);
            
            // Reset counts to 0 on error
            document.querySelectorAll('#statistics td:nth-child(2)').forEach(cell => {
                cell.textContent = '0';
                cell.style.color = 'var(--text-primary)';
            });
        });
}

// Update date and time display
function updateDateTime() {
    const now = new Date();
    const dateOptions = { 
        weekday: 'long', 
        year: 'numeric', 
        month: 'long', 
        day: 'numeric' 
    };
    
    const timeOptions = { 
        hour: '2-digit', 
        minute: '2-digit', 
        second: '2-digit',
        hour12: true
    };
    
    const dateStr = now.toLocaleDateString('en-US', dateOptions);
    const timeStr = now.toLocaleTimeString('en-US', timeOptions);
    
    document.getElementById("date").textContent = dateStr;
    document.getElementById("time").textContent = timeStr;
}

