// Show/hide sections
function showSection(sectionId) {
    // Hide all sections
    document.querySelectorAll('.section').forEach(section => {
        section.style.display = 'none';
    });
    
    // Show selected section
    const section = document.getElementById(sectionId);
    if (section) {
        section.style.display = 'block';
        
        // Special handling for registration section
        if (sectionId === 'registration') {
            checkRegistrationPeriod();
        }
        
        // If statistics section is shown, fetch data for the selected year
        if (sectionId === 'statistics') {
            checkAndFetchStatistics();
        }
    }
    
    // Update active nav link
    document.querySelectorAll('.nav-link').forEach(link => {
        link.classList.remove('active');
    });
    
    // Find the link that matches the section and make it active
    const links = document.querySelectorAll('.nav-link');
    for (let link of links) {
        if (link.textContent.toLowerCase() === sectionId.toLowerCase() || 
            (sectionId === 'registration' && link.textContent.toLowerCase().includes('register'))) {
            link.classList.add('active');
            break;
        }
    }
    
    // Add fade-in animation
    document.getElementById(sectionId).classList.add('fade-in');
    setTimeout(() => {
        document.getElementById(sectionId).classList.remove('fade-in');
    }, 800);
}

