// Admin authentication
function authenticateUser() {
    const authorizedStaff = ["suman", "manoranjan", "chandan", "dhrubajyoti", "binoy"];
    
    // Show authentication modal
    const authModal = document.createElement('div');
    authModal.style.position = 'fixed';
    authModal.style.top = '0';
    authModal.style.left = '0';
    authModal.style.width = '100%';
    authModal.style.height = '100%';
    authModal.style.backgroundColor = 'rgba(0,0,0,0.8)';
    authModal.style.display = 'flex';
    authModal.style.justifyContent = 'center';
    authModal.style.alignItems = 'center';
    authModal.style.zIndex = '1000';
    
    authModal.innerHTML = `
        <div style="background: #1e1e1e; padding: 2rem; border-radius: 12px; max-width: 400px; width: 90%; border: 1px solid #7c4dff; box-shadow: 0 0 30px rgba(124, 77, 255, 0.3);">
            <h2 style="color: #7c4dff; text-align: center; margin-bottom: 1.5rem;">Staff Authentication</h2>
            <p style="color: #e0e0e0; margin-bottom: 1.5rem; text-align: center;">Please enter your username to access the registration system</p>
            <input type="text" id="authUsername" placeholder="Enter username" style="width: 100%; padding: 0.8rem; margin-bottom: 1rem; background: #2a2a2a; border: 1px solid #444; border-radius: 8px; color: white;">
            <button id="authSubmit" style="width: 100%; padding: 0.8rem; background: linear-gradient(135deg, #7c4dff, #4a00b3); color: white; border: none; border-radius: 8px; font-weight: bold; cursor: pointer;">Submit</button>
        </div>
    `;
    
    document.body.appendChild(authModal);
    
    document.getElementById('authSubmit').addEventListener('click', function() {
        const userName = document.getElementById('authUsername').value.trim().toLowerCase();
        
        if (authorizedStaff.includes(userName)) {
            authModal.style.display = 'none';
            document.body.removeChild(authModal);
        } else {
            alert('⛔ Access Denied! You are not authorized to view this page.');
            window.location.href = "https://www.google.com";
        }
    });
}